import { Exercise } from "./Exercise";

export const ExercisesList = ({
  exercises,
  removeExercise,
  updateLikeExercise,
}) => {
  return exercises.length ? (
    <ul>
      {exercises.map((exercise) => (
        <li key={exercise.id}>
          <Exercise
            exercise={exercise}
            removeExercise={removeExercise}
            updateLikeExercise={updateLikeExercise}
          />
        </li>
      ))}
    </ul>
  ) : (
    <p>No hay ejercicios</p>
  );
};
